package PairNumbers;

public class Test {
    public static void main(String[] args) {
        Integer i;
        Pair<Integer,String> pair1 = new Pair<Integer, String>(i,"Primeiro valor");
        Pair<Integer,String> pair2 = new Pair<Integer, String>(i, "Segundo valor");
        System.out.println(pair1.getKey()+ " " + pair1.getValue()+ " ");
        System.out.println(pair2.getKey()+ " " + pair2.getValue()+ " ");
    }
}
